function PopularTags() {
  return (
    <>
      <h3 className="widget-title">Popular Tags</h3>

      <div className="tagcloud">
        <a href="#">Electronics</a>
        <a href="#">Business</a>
        <a href="#">Policy</a>
        <a href="#">Benefits</a>
        <a href="#">Ecommerce</a>
        <a href="#">Audio</a>
        <a href="#">Camera</a>
        <a href="#">Watches</a>
      </div>
    </>
  );
}

export default PopularTags;
